import React from 'react';
import styled from "styled-components";
import Tags from './tags';
import { Card } from "antd";

const Wrapper = styled.article`
  margin: 0px;
  width: 346px;
  height: 350px;
  border: solid 1px;
  border-radius: 10px;

  .textBoxes {
    margin-left: 10px;
  }

  .itemBoxes {
    display: flex;
    justify-content: space-between;
    align-items: flex-end;
    margin-left: 10px;
    margin-right: 10px;
  }

  .like {
    display: flex;
		flex-direction: column;
		align-items: center;
  }

  .likeButton {
    display: block;
    cursor: pointer;
  }
`;

const GatherCards = (props) => {
	return (
    <>
    <Wrapper>
      <img src="assets/images/gatherCardThumbnail.png" alt="thumbnail" />
      <div className="textBoxes">
        <h3>독서모임 이름</h3>
        <p>한 줄 소개</p>
      </div>
      <div className="itemBoxes">
        <span className="tags">
          <Tags></Tags>
          <Tags></Tags>
        </span>
        <div className="like">
          <img className="likeButton" src="assets/images/heart.png" alt="icon"/>
          <span>9,999</span>
        </div>
			</div>
    </Wrapper>
    </>
	);
};

export default GatherCards;
